import React, { useEffect, useState } from 'react';

export default function Circle() {

    const [user, setUser] = useState({});
    useEffect(() => {
        fetch('https://online.ntnu.no/api/v1/users/?rfid=0260434848')
        .then(res => res.json())
        .then(res => console.log(res.results))
    }, [])

    return (
        <div> Hi! </div>
    )
}
